import './../css/Home.css'
import { useLogsContext } from '../hooks/useLogsContext'
import { LogsContextProvider } from './context/LogsContext';

import { useEffect } from 'react'
import SchoolLogo from '../assets/logo.png'

const StudentView = ({log}) => {
    const { logs, dispatchLogs } = useLogsContext()

    useEffect(() => {
      const fetchLogs = async () => {
        const response = await fetch('/api/logs')
        const json = await response.json()
  
        if (response.ok) {
            console.log("Database Response OK")
            console.log(json)
          dispatchLogs({type: 'SET_LOGS', payload: json})
        } else {
            console.log("Database Response NOT OK")
        }
      }
  
      fetchLogs()
    }, [dispatchLogs])
    return (
        <LogsContextProvider>
            <div className="home">
                <div className="studentProfile">
                    <div className="studentProfileHeader">
                        <img className="schoolLogo" src={SchoolLogo}></img>
                        <h2>Signed in with Google (usc.edu.ph)</h2>
                    </div>
                    <div className="studentDetail">
                        <h3>Name:</h3>
                        <p>Matt Erron G. Cabarrubias</p>
                    </div>

                    <div className="studentDetail">
                        <h3>Student ID:</h3>
                        <p>22103604<i class="fa-solid fa-pen-to-square"></i></p>
                    </div>

                    <div className="studentDetail">
                        <h3>Blocksection:</h3>
                        <p>STEM 12 - ST<i class="fa-solid fa-pen-to-square"></i></p>
                    </div>

                    <div className="studentDetail">
                        <h3>Lab group:</h3>
                        <p>31<i class="fa-solid fa-pen-to-square"></i> </p>
                    </div>
                </div>

                <div className="logForm">
                    <h2>Log Form</h2>
                    <div className="apparatus">
                        <div className="apparatusList">

                        </div>
                    </div>

                </div>
            </div>
        </LogsContextProvider>

    )
}

export {
    StudentView
}
